INSERT INTO `faq` (`id_faq`, `question`, `answer`) VALUES
(2, 'Apa itu KLIK JEMPOL?', 'KLIK JEMPOL merupakan bentuk Inovasi BPS Provinsi Sumatera Selatan untuk meningkatkan kualitas pelayanan dengan memberikan informasi terkini mengenai produk BPS Provinsi Sumatera Selatan kepada para konsumen data.'),
(3, 'Data/informasi apa saja yang akan diterima dari layanan KLIK JEMPOL?', 'Data/informasi yang akan diterima dari layanan KLIK JEMPOL antara lain: Softcopy publikasi, Tabel data, Unsur kegiatan, Berita, etc.'),
(4, 'Apa persyaratan untuk menerima layanan KLIK JEMPOL?', 'Untuk menerima layanan KLIK JEMPOL dari kami Bapak/Ibu harus bersedia menerima dan memperoleh secara terus-menerus informasi terkini terkait data statistik, dengan melakukan pendaftaran dengan mengisi form yang disediakan.'),
(5, 'Apakah layanan KLIK JEMPOL ini berbayar?', 'Layanan KLIK JEMPOL ini tidak dipungut biaya (gratis).');
