INSERT INTO `template` (`id_template`, `subject`, `body`, `nama_produk`, `lampiran`, `status`) VALUES
(1, 'KLIK JEMPOL #14', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan&nbsp;</span><i style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">softcopy</i><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">&nbsp;Berita Resmi Statistik (BRS) Pertumbuhan Ekonomi TW II 2021 Provinsi Sumatera Selatan. Sahabat Data bisa mengetahui apakah perekonomian Sumsel tetap tumbuh atau terkonstraksi selama periode April-Juni 2021? Mengingat masih terdampak pandemi&nbsp;</span><i style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Covid-19</i><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Bila dibandingkan kondisi TW II 2020, perekonomian Sumsel di TW II 2021 masih tumbuh sebesar 5,71 persen, sektor apa saja yang menyebabkan pertumbuhan ekonomi tetap tumbuh?</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data bisa melihat penjelasan terkait pertanyaan di atas melalui data BRS yang kami kirimkan.</span><br></div>', 'BRS Pertumbuhan Ekonomi 2021', 'https://drive.google.com/file/d/1haQW5Xwz4C6Akg5jYjBxmDWkchctBnVC/view', 1),
(4, 'KLIK JEMPOL #2', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Bapak/Ibu Sahabat Data Klik Jempol, berikut ini kami kirimkan softcopy Berita Resmi Statistik (BRS) berupa Data Pertumbuhan Ekonomi Sumsel Triwulan 1 2021 dan Data Ketenagakerjaan kondisi Februari 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Beberapa info terkait BRS yaitu: Pertumbuhan Ekonomi TW 1 2021 mengalami kontraksi sebesar 0.41% dibandingkan dengan TW 1 2020 (y o y), akan tetapi Pengangguran di Sumsel kondisi Februari 2021 berkurang sebanyak 22 ribu orang bila dibandingkan dengan Agustus 2020. Bagaimana penjelasan terkait hal tersebut?silakan dilihat analisis pada Berita Resmi Statistik yang kami kirimkan.</span></div>', 'Softfile BRS 5 Mei 2021', 'https://drive.google.com/drive/folders/10WgmBEpnGPcH8sx9MnbB_YbXzUn0mLkM?usp=sharing', 1),
(5, 'KLIK JEMPOL #4', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, Indikator kesejahteraan suatu daerah dapat dilihat salah satunya melalui data jumlah penduduk miskin. BPS Prov. Sumsel memiliki series data kemiskinan per Kabupaten/Kota mulai tahun 2005-2020.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Bagaimana sih perkembangan jumlah penduduk miskin di wilayah Sumatera Selatan tiap tahunnya? Sahabat Data bisa melihat melalui data kemiskinan yang kami kirimkan.</span><br></div>', 'Softfile Data Jumlah Penduduk Miskin', 'https://drive.google.com/file/d/1Oj6rpaVzDm2NamSawJSyZsyn3AX6Gtqa/view?usp=sharing', 1),
(6, 'KLIK JEMPOL #5', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan softcopy Berita Resmi Statistik (BRS) berupa data perkembangan Ekspor Impor Provinsi Sumatera Selatan di Bulan April 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Bagaimana sih perkembangan neraca perdagangan Provinsi Sumsel? Apakah masih surplus ekspor Sumsel dibandingkan Impor? Sahabat Data bisa melihat melalui data BRS yang kami kirimkan.</span><br></div>', 'Softfile BRS 20 Mei 2021', 'https://drive.google.com/file/d/1u7hxREoD1OAfLWHc8oW0I_LK30Av-hL1/view?usp=sharing', 1),
(7, 'KLIK JEMPOL #6', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan softcopy Berita Resmi Statistik (BRS) berupa data perkembangan Inflasi, Nilai Tukar Petani, Transportasi dan Pariwisata Provinsi Sumatera Selatan di Bulan Mei dan April 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Kota Palembang pada Bulan Mei mengalami deflasi, komoditas apa saja yang menyebabkan anomali tersebut? Bagaimana dengan NTP tanaman pangan di Sumatera Selatan, apakah masih turun di Mei 2021? Sahabat Data bisa melihat penjelasan terkait fenomena di atas melalui data BRS yang kami kirimkan.</span><br></div>', 'Softfile BRS 2 Juni 2021', 'https://drive.google.com/drive/folders/1V-3DAoQwRc4zAEuvpr8pD2FHEitHwVsB?usp=sharing', 1),
(8, 'KLIK JEMPOL #7', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan softcopy Tabel I-O (input output) Sumatera Selatan Tahun 2016. Apakah Sahabat Data mengetahui apa yang dimaksud Tabel I-O?</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Terdapat 6 leading sectors Pembangunan Ekonomi di Provinsi Sumatera Selatan pada Tahun 2016. Salah satu sektornya adalah Pertambangan Batubara dan Lignit, ingin mengetahui sektor apa saja yang lainnya? Sahabat Data bisa melihat data terkait Tabel I-O dan Infografis yang kami kirimkan.</span><br></div>', 'Softfile Tabel I-O dan Infografis', 'https://drive.google.com/drive/folders/1gAhuzL21gFkgaY4M9gSqK9rMdt-OQV2O?usp=sharing', 1),
(9, 'KLIK JEMPOL #8', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, Badan Pusat Statistik (BPS) merupakan penyelenggara pelayanan publik yang memiliki tugas dan tanggung jawab untuk memberikan pelayanan melalui penyediaan data dan informasi statistik, baik kepada pemerintah maupun masyarakat secara luas. Dalam menyebarluaskan data dan informasi statistik, BPS menyediakan unit Pelayanan Statistik Terpadu (PST) baik di BPS pusat, BPS provinsi, dan BPS kabupaten/kota, untuk dapat memberikan layanan statistik.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Survei Kebutuhan Data (SKD) adalah survei yang dirancang dan dilakukan oleh BPS guna melakukan evaluasi dan pemantauan pelayanan, sesuai dengan Peraturan Kepala BPS No. 99 Tahun 2014 tentang Penyelenggaraan Survei Kebutuhan Data. Selain evaluasi, SKD juga mengkaji ketersediaan data dan informasi yang dibutuhkan pengguna sebagai wujud dari salah satu visi BPS sebagai penyedia data statistik berkualitas untuk Indonesia Maju.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Untuk itu, berikut ini kami kirimkan tautan&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">agar sahabat data dapat berpartisipasi dalam menilai pelayanan data dan Informasi Statistik di BPS Provinsi Sumatera Selatan.</span></div>', ' Survei Kebutuhan Data', 'http://s.bps.go.id/SKD2021-1600', 1),
(10, 'KLIK JEMPOL #9', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan softcopy Berita Resmi Statistik (BRS) berupa data perkembangan Inflasi, Nilai Tukar Petani, Transportasi, Pariwisata dan Ekspor Impor Provinsi Sumatera Selatan di Bulan Juni 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sumatera Selatan pada Bulan Mei mengalami deflasi, komoditas apa saja yang menyebabkan hal tersebut? Apakah daya beli masyarakat memang menurun? Kabar gembira untuk NTP tanaman pangan di Bulan Juni 2021 meningkat, yang pada periode sebelumnya selalu menurun.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data bisa melihat penjelasan terkait fenomena di atas melalui data BRS yang kami kirimkan.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"></div>', 'Softfile BRS Juli 2021', 'https://drive.google.com/drive/folders/1CW1Vdr6hNr_mfG8NOTv0jOwpc_N1qiOm?usp=sharing', 1),
(11, 'KLIK JEMPOL #10', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Badan Pusat Statistik kembali menyelenggarakan survei untuk mendapatkan informasi perilaku masyarakat situasi pandemi ini melalui \"Survei Perilaku Masyarakat Pada Masa Pandemi COVID-19 secara daring/online selama 13-20 Juli 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Kami memohon partisipasinya pada Survei Perilaku Masyarakat Pada Masa Pandemi COVID-19 ini, dengan mengisi kuesioner melalui tautan berikut ini:</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><a href=\"https://survey.bps.go.id/open/covid\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://survey.bps.go.id/open/covid&amp;source=gmail&amp;ust=1634982887984000&amp;usg=AFQjCNEWt7TLEpc5O4ht4HKoNbZvq9fstw\" style=\"color: rgb(17, 85, 204); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Survei Perilaku Masyarakat Pada Masa Pandemi COVID-19</a><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Hanya diperlukan sekitar 10 menit untuk menyelesaikannya.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Pertanyaan dalam survei mencakup perilaku masyarakat di tengah pandemi dan bagaimana masyarakat menyikapi situasi pandemi.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Kerahasiaan jawaban Anda akan tetap terjaga.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Hasil survei dapat memberikan informasi penting bagi pemerintah dalam menangani dampak COVID-19.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Catatan: Mohon dapat menyebarkan link survei ini ke seluruh jaringan pertemanan, keluarga, rekan kerja, dan lainnya dalam lingkup wilayah NKRI.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">#DiRumahAja</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">#BersamaMelawanCorona</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">#MelayaniDenganPIA</span><br></div>', 'Survei Perilaku Masyarakat Pada Masa Pandemi COVID-19', 'https://survey.bps.go.id/open/covid', 1),
(12, 'KLIK JEMPOL #11', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan softcopy Berita Resmi Statistik (BRS) Kemiskinan Provinsi Sumatera Selatan Kondisi Maret 2021, Sahabat Data bisa mengetahui berapa persen jumlah penduduk miskin di Sumsel, bagaimana tentang kondisi kedalaman dan keparahan penduduk miskin di maret 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Bila dibandingkan September 2021, apakah persentase penduduk miskin menurun? Berapa jumlah penduduk miskin di Sumsel kondisi Maret 2021?</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data bisa melihat penjelasan terkait pertanyaan di atas melalui data BRS yang kami kirimkan.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"></div>', 'Produk BRS Kemiskinan Maret 2021', 'https://drive.google.com/drive/folders/1GT37dzJjWbC8zTBBpBq5Jm5XHOmfTF_T?usp=sharing', 1),
(13, 'KLIK JEMPOL #12', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut ini kami kirimkan&nbsp;</span><i style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">softcopy</i><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">&nbsp;Berita Resmi Statistik (BRS) berupa data perkembangan Inflasi Juli, Nilai Tukar Petani Juli, Transportasi Juni, Pariwisata Juni, dan Ekspor Impor Juni Provinsi Sumatera Selatan 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sumatera Selatan pada Bulan Juli mengalami deflasi, komoditas apa saja yang menyebabkan hal tersebut? Apakah memang benar daya beli masyarakat memang menurun? Bagaimana dengan kelompok pengeluaran Inti, apakah masih naik harganya?.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data bisa melihat penjelasan terkait fenomena di atas melalui data BRS yang kami kirimkan.</span><br></div>', 'Produk BRS 2021', 'https://drive.google.com/drive/folders/1y6JvlrQJ63LSnL_vFoDwugkT_jOup9-2?usp=sharing', 1),
(14, 'KLIK JEMPOL #13', '<div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Sahabat Data Klik Jempol, berikut kami kirimkan publikasi hasil \"Survei Perilaku Masyarakat Pada Masa Pandemi&nbsp;</span><i style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">COVID-19</i><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"> yang telah dilaksanakan secara daring/</span><i style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">online</i><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">&nbsp;selama 13-20 Juli 2021.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Kami ucapkan terima kasih atas partisipasinya.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Bagaimana perilaku masyarakat di tengah pandemi? dan bagaimana masyarakat menyikapi situasi pandemi? Apakah masyarakat disiplin memakai masker dua lapis pada saat PPKM Darurat?</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Jawaban pertanyaan di atas dapat dilihat pada publikasi yang kami kirimkan.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"></div>', 'Survei Perilaku Masyarakat Pada Masa Pandemi COVID-19', 'https://drive.google.com/file/d/1_PqNSBHh8FoRtcOEQdu7Dsr1BTKsYF7V/view?usp=sharing', 1);
